import React from "react";
import {useParams} from "react-router-dom";
import {useTags} from "../useTags";

type Params = {
    id:any;
}
const TagEdit: React.FC = () => {
    const {tags,findTag} = useTags();
    let {id} = useParams<Params>();
    const tag = findTag(id)
return(
    <div>
        {tag.name}
    </div>
);
}
export {TagEdit};
